import { Outlet } from "react-router-dom";
import { Link } from "react-router-dom";
import { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";

const displayProperty = (property) => {
    return (
        <>
        <div class="box">
        <article class="media">
            <div class="media-left">
            <figure class="image is-64x64">
                <img src="https://bulma.io/images/placeholders/128x128.png" alt="Image" />
            </figure>
            </div>
            <div class="media-content">
            <div class="content">
                <p>
                <strong>John Smith</strong> <small>@johnsmith</small> <small>31m</small>
                <br/>
                Lorem ipsum dolor sit amet, consectetur adipiscing elit. Aenean efficitur sit amet massa fringilla egestas. Nullam condimentum luctus turpis.
                </p>
            </div>
            <nav class="level is-mobile">
                <div class="level-left">
                <a class="level-item" aria-label="reply">
                    <span class="icon is-small">
                    <i class="fas fa-reply" aria-hidden="true"></i>
                    </span>
                </a>
                <a class="level-item" aria-label="retweet">
                    <span class="icon is-small">
                    <i class="fas fa-retweet" aria-hidden="true"></i>
                    </span>
                </a>
                <a class="level-item" aria-label="like">
                    <span class="icon is-small">
                    <i class="fas fa-heart" aria-hidden="true"></i>
                    </span>
                </a>
                </div>
            </nav>
            </div>
        </article>
        </div>
        </>
    );
};

const MyPropertyList = () => {
    const [properties, setProperties] = useState([]);
    const [userID, setUserID] = useState(-1);
    const navigate = useNavigate();

    useEffect(() => {
        
        // get the user id
		fetch("http://127.0.0.1:8000/accounts/info/",{
            method: 'GET',
            headers: {
                'Authorization': 'Bearer ' + localStorage.getItem('token')
            }
        })
        .then((response) => response.json())
        .then((data) => {
            setUserID(data.id);
        }
        ).then(() => {

            // get the properties that belong to the user
            fetch("http://localhost:8000/property/list/?owner=" + userID, {
                method: 'GET',
                headers: {
                    'Authorization': 'Bearer ' + localStorage.getItem('token')
                }
            })
            .then((response) => response.json())
            .then((data) => {
                console.log(data);
                setProperties(data);
            }
            );
        });
    }, [userID]);

    return (
        <>
            <div className="container">
                {
                    properties.map((property) => {
                        return displayProperty(property);
                    }
                    )
                }
            </div>
        </>
    );
};

export default MyPropertyList;
